      <Row>
        <Col sm={6}>

            <Image src={props.image} fluid />
        </Col>
        <Col sm={6}>
          <div style={{display:"flex",justifyContent:"center",alignItems:"center",height:"100%",color:"white"}}>
            <div>
              <h1>{props.header}</h1>
              <p>{props.body}</p>
            </div>
          </div>

        </Col>
      </Row>
    </Container>


);

